                showgrid: false, 
                title: '\alpha'
              },
              width: 500,
              height: 500,

            }}
        />
      </div>

      <div className="Div"></div>
      <div>
        <Plot 
          data= {[
            {
              x: this.state.xax,
              y: this.state.yax,
              type: 'scatterg1', 
              mode: 'points',
              marker: {color: 'red'}, 
              name: 'Data Testing '
              }
            ]}
              layout ={{
              width: '700', height: '400', 
              title: 'Path epsilon-alpha space', 
              xaxis: {
                range: [0, 1],
                zeroline: true, 
                title: '\epsilon' 
              },
              yaxis: {
                range: [-0.05, 0.1],
                showgrid: false, 
                title: '\alpha'
              },
              width: 500,
              height: 500,

            }}
        />
